requests.postData:
{"query":"{
    globals {
      fees {
        mintFee
        randomRedeemFee
        targetRedeemFee
        randomSwapFee
        targetSwapFee
      }
    }
    vaults(first: 1000, where: { vaultId_gte: 0 isFinalized: true totalHoldings_gt: 0 }) {
      vaultId
      id
      is1155
      isFinalized
      totalHoldings
      totalMints
      totalRedeems
      totalFees
      totalSwaps
      createdAt
      shutdownDate
      holdings(first: 1000 orderBy: tokenId orderDirection: asc) {
        id
        tokenId
        amount
        dateAdded
      }
      token {
        id
        name
        symbol
      }
      fees {
        mintFee
        randomRedeemFee
        targetRedeemFee
        randomSwapFee
        targetSwapFee
      }
      usesFactoryFees
      asset {
        id
        name
        symbol
      }
      manager {
        id
      }
      createdBy {
        id
      }
      eligibilityModule {
        id
        name
        eligibleIds
        eligibleRange
      }
      features {
        enableMint
        enableRandomRedeem
        enableTargetRedeem
        enableRandomSwap
        enableTargetSwap
      }
      inventoryStakingPool {
        id
        dividendToken {
          symbol
        }
      }
      lpStakingPool {
        id
        stakingToken {
          id
        }
      }
    }
  }"}

{"query":"{
      mints(
        first: 1000,
        where: { date_gt: "1672317600" },
        orderBy: date,
        orderDirection: asc
      ) {
        id
        zapAction {
          ethAmount
          id
        }
        source
        vault {
          id
          vaultId
          token {
            symbol
          }
          asset {
            id
          }
          inventoryStakingPool {
            id
          }
        }
        user {
          id
        }
        date
        nftIds
        amounts
        feeReceipt {
          transfers {
            amount
          }
          date
        }
      }
    }
"}

