{"query":"{
    pools(first:1000, where: {
      deployBlock_gte: 13011203
      # weird duplicate arbitrum pool
      id_not: "0xc5d592305a8ac4cce16485ab46b6b8bf593f5bce"
    }) {
      id
      vault {
        id
        createdAt
        vaultId
        totalHoldings
        isFinalized
        token
        inventoryStakingPool {
          id
        }
        eligibilityModule {
          name
          id
        }
      }
      deployBlock
      stakingToken {
        id
        symbol
      }
      dividendToken { # tokenized stake token i.e. xPUNK
        id
        symbol
      }
      rewardToken {
        id
        symbol
      }
    }
  }"}

